import React from "react";
import { Box, Typography, Grid, Button } from "@material-ui/core";

export default (props) => {
    return (
        <Box>
            <Grid item xs>
                <Typography variant="subtitle 1">Frontend Dev</Typography>
                <Typography variant="">Google</Typography>
            </Grid> 
            <Grid item xs></Grid> 
            <Grid item xs></Grid> 
        </Box>
    )
}
